import { useEffect, useState } from "react";
import { useParams, useNavigate, Link } from "react-router-dom";
import axios from "axios";

const BirdEditPage = () => {
  const { id } = useParams();
  const navigate = useNavigate();

  const [name, setName] = useState('');
  const [species, setSpecies] = useState('');
  const [family, setFamily] = useState('');
  const [habitat, setHabitat] = useState('');
  const [placeOfFound, setPlaceOfFound] = useState('');
  const [diet, setDiet] = useState('');
  const [description, setDescription] = useState('');
  const [weightKg, setWeightKg] = useState('');
  const [heightCm, setHeightCm] = useState('');
  const [image, setImage] = useState('');
  const [showModal, setShowModal] = useState(false);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(`http://localhost:5555/api/birds/${id}`, { withCredentials: true });
        setName(response.data.name);
        setSpecies(response.data.species);
        setFamily(response.data.family);
        setHabitat(response.data.habitat);
        setPlaceOfFound(response.data.place_of_found);
        setDiet(response.data.diet);
        setDescription(response.data.description);
        setWeightKg(response.data.weight_kg);
        setHeightCm(response.data.height_cm);
        setImage(response.data.image);
      } catch (error) {
        alert(error?.response?.data?.message || error.message);
      }
    };

    fetchData();
  }, [id]);

  const submitHandler = async (e) => {
    e.preventDefault();
    try {
      await axios.put(`http://localhost:5555/api/birds/${id}`, {
        name,
        species,
        family,
        habitat,
        place_of_found: placeOfFound,
        diet,
        description,
        weight_kg: weightKg,
        height_cm: heightCm,
        image
      }, { withCredentials: true });
      setShowModal(true);
    } catch (error) {
      alert(error?.response?.data?.message || error.message);
    }
  }

  const createUploadHandler = async (e) => {
    const file = e.target.files[0];
    const formData = new FormData();
    formData.append('image', file);

    try {
      const response = await axios.post('http://localhost:5555/api/uploads', formData, { withCredentials: true });
      setImage(response.data.image);
      alert('Image uploaded successfully');
    } catch (error) {
      alert(error?.response?.data?.message || error.message);
    }
  }

  const closeModal = () => {
    setShowModal(false);
    navigate(`/birds/dashboard/`);
  }

  return (
    <div style={{ display: "flex", justifyContent: "center", alignItems: "center", backgroundColor: "#f7fafc", minHeight: "100vh", padding: "40px 0" }}>
      <div style={{ width: "100%", maxWidth: "800px", padding: "0 16px" }}>
        <h1 style={{ fontSize: "32px", fontWeight: "bold", textAlign: "center", color: "#2c5282", marginBottom: "32px" }}>Edit Bird</h1>
        <div style={{ backgroundColor: "#fff", padding: "32px", borderRadius: "8px", boxShadow: "0 10px 15px rgba(0, 0, 0, 0.1)" }}>
          <form onSubmit={submitHandler}>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Name</label>
              <input type="text" placeholder="Enter name" value={name} onChange={(e) => setName(e.target.value)} style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }} required />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Species</label>
              <input type="text" placeholder="Enter species" value={species} onChange={(e) => setSpecies(e.target.value)} style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }} required />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Family</label>
              <input type="text" placeholder="Enter family" value={family} onChange={(e) => setFamily(e.target.value)} style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }} required />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Habitat</label>
              <input type="text" placeholder="Enter habitat" value={habitat} onChange={(e) => setHabitat(e.target.value)} style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }} required />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Place of Found</label>
              <input type="text" placeholder="Enter place of found" value={placeOfFound} onChange={(e) => setPlaceOfFound(e.target.value)} style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }} required />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Diet</label>
              <input type="text" placeholder="Enter diet" value={diet} onChange={(e) => setDiet(e.target.value)} style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }} required />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Description</label>
              <textarea placeholder="Enter description" value={description} onChange={(e) => setDescription(e.target.value)} style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box", resize: "none" }} rows="5" required />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Weight (kg)</label>
              <input type="number" placeholder="Enter weight in kg" value={weightKg} onChange={(e) => setWeightKg(e.target.value)} style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }} required />
            </div>
            <div style={{ marginBottom: "16px" }}>
              <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Height (cm)</label>
              <input type="number" placeholder="Enter height in cm" value={heightCm} onChange={(e) => setHeightCm(e.target.value)} style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box" }} required />
            </div>
            <div style={{ marginBottom: "16px" }}>
            <label style={{ display: "block", color: "#4a5568", fontSize: "14px", fontWeight: "bold", marginBottom: "8px" }}>Image</label>
              <input
                type="text"
                value={image}
                onChange={(e) => setImage(e.target.value)}
                disabled
                style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box", backgroundColor: "#edf2f7" }}
              />
              <input
                type="file"
                placeholder="Upload image"
                onChange={createUploadHandler}
                style={{ width: "100%", padding: "12px", border: "1px solid #e2e8f0", borderRadius: "4px", outline: "none", boxSizing: "border-box", marginTop: "8px" }}
              />
            </div>
            <div style={{ textAlign: "center" }}>
              <button type="submit" style={{ backgroundColor: "#2c5282", width: "100%", color: "#fff", fontWeight: "bold", padding: "12px 24px", borderRadius: "4px", transition: "background-color 0.3s", cursor: "pointer" }}>
                Update
              </button>
              <Link to="/birds/dashboard" style={{ backgroundColor: "#a0aec0", width: "100%", color: "#fff", fontWeight: "bold", padding: "12px 24px", borderRadius: "4px", transition: "background-color 0.3s", marginTop: "8px", display: "inline-block", textDecoration: "none", textAlign: "center" }}>
                Cancel
              </Link>
            </div>
          </form>
        </div>
      </div>
      {showModal && (
        <div style={{ position: "fixed", top: 0, left: 0, right: 0, bottom: 0, backgroundColor: "rgba(0,0,0,0.5)", display: "flex", justifyContent: "center", alignItems: "center" }}>
          <div style={{ backgroundColor: "#fff", padding: "32px", borderRadius: "8px", boxShadow: "0 10px 15px rgba(0, 0, 0, 0.1)", textAlign: "center" }}>
            <h2 style={{ fontSize: "24px", marginBottom: "16px" }}>Bird updated successfully</h2>
            <button onClick={closeModal} style={{ backgroundColor: "#2c5282", color: "#fff", fontWeight: "bold", padding: "12px 24px", borderRadius: "4px", cursor: "pointer" }}>
              OK
            </button>
          </div>
        </div>
      )}
    </div>
  )
}

export default BirdEditPage;
